import header_img from '../images/header_img.jpg';
import uzh from '../images/uzh.svg';
import './App.css';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';

class App extends React.Component {
    render() {
        return <div className="App">
            <header className="App-header" style= { {
                backgroundImage: `url(${header_img})`
            }
            }>
                <div className="App-logo">
                    <img src={uzh} alt={"uzh_logo"}/>
                </div>
                <div>
                    <h1 className="App-title">LAWrgMiner Project</h1>
                    <hr className="solid"></hr>
                    <h4>Artificial Intelligence: Technology and Law</h4>
                    <Button variant="outlined" >Use LAWrgMiner</Button>
                </div>
            </header>
            <body>
            <h2 style={{position: "relative",  left: "10%"}}>Introduction</h2>

            </body>
        </div>
    }
}

export default App;
